import { createSlice } from "@reduxjs/toolkit"

const productSlice=createSlice({
  name: 'products',
  initialState:{},
  reducers:{
    setProducts:(state,action)=>{
        console.log("set products");
    }
  }
})

export const {setProducts}=productSlice.actions
export default productSlice.reducer;
